ROYGBIV.setPosition(gun2, bodyXPosition2.x, bodyXPosition2.y, bodyXPosition2.z);

ROYGBIV.globals.gun1Pointer = ROYGBIV.getChildObject(gun1, "gun1Pointer");
ROYGBIV.globals.gun2Pointer = ROYGBIV.getChildObject(gun2, "gun2Pointer");

var bodyPosition = ROYGBIV.getPosition(body);
var gun1Position = ROYGBIV.getPosition(gun1);
var gun2Position = ROYGBIV.getPosition(gun2);
var gun1BodyPosition = ROYGBIV.getPosition(gun1Body);
var gun2BodyPosition = ROYGBIV.getPosition(gun2Body);

ROYGBIV.rotate(gun1, "y", 0.4);
ROYGBIV.rotate(gun2, "y", -0.4);

var gun1HorizontalRotationPivot = ROYGBIV.createRotationPivot(
  gun1, (bodyPosition.x - gun1Position.x), (bodyPosition.y - gun1Position.y), (gun1BodyPosition.z - gun1Position.z)
);
var gun2HorizontalRotationPivot = ROYGBIV.createRotationPivot(
  gun2, (bodyPosition.x - gun2Position.x), (bodyPosition.y - gun2Position.y), (gun2BodyPosition.z - gun2Position.z)
);

ROYGBIV.setRotationPivot(gun1HorizontalRotationPivot);
ROYGBIV.setRotationPivot(gun2HorizontalRotationPivot);

ROYGBIV.globals.rotateHorizontal = function(d){
  if (!isPointerLocked){
    return;
  }
  ROYGBIV.rotate(gun1, "y", d);
  ROYGBIV.rotate(gun2, "y", d);
  camera.rotation.y += d;
  ROYGBIV.globals.alpha -= (d);
};

ROYGBIV.globals.rotateVertical = function(d){
  if (!isPointerLocked){
    return;
  }
  if (d > 0 && totalVerticalRotation + d >= 1.10){
    return;
  }
  if (d <0 && totalVerticalRotation + d <= -1.10){
    return;
  }
  ROYGBIV.rotate(gun1, "x", d);
  ROYGBIV.rotate(gun2, "x", d);
  camera.rotation.x += d;
  totalVerticalRotation += d;
}

ROYGBIV.setScreenPointerLockChangeListener(function(isOn){
  isPointerLocked = isOn;
  if (!isOn){
    ROYGBIV.requestPointerLock();
    ROYGBIV.terminal(true);
    ROYGBIV.terminalPrompt(false);
    ROYGBIV.pause(true);
  }else{
    ROYGBIV.terminal(false);
    ROYGBIV.terminalPrompt(false);
