};
ROYGBIV.setScreenMouseDownListener(function(){
  ROYGBIV.globals.mouseDown = true;
  for (var key in moveKeys){
    if (ROYGBIV.isKeyPressed(key)){
      return;
    }
  }
  ROYGBIV.expandCrosshair(9, 0.2);
});
ROYGBIV.setScreenMouseUpListener(function(){
