  for (var key in moveKeys){
    if (ROYGBIV.isKeyPressed(key)){
      return;
    }
  }
  ROYGBIV.shrinkCrosshair(0.2);
});
ROYGBIV.setScreenKeydownListener(function(char){
  if (ROYGBIV.globals.mouseDown){
    return;
  }
  for (var key in moveKeys){
    if (key != char && ROYGBIV.isKeyPressed(key)){
      return;
    }
  }
  if (moveKeys[char]){
    ROYGBIV.expandCrosshair(9, 0.2);
  }
});
ROYGBIV.setScreenKeyupListener(function(char){
  if (ROYGBIV.globals.mouseDown){
    return;
  }
  for (var key in moveKeys){
    if (ROYGBIV.isKeyPressed(key)){
      return;
    }
  }
  if (moveKeys[char]){
    ROYGBIV.shrinkCrosshair(0.2);
  }
});

var rayFromVector = ROYGBIV.vector(0, 0, 0);
var rayDirectionVector = ROYGBIV.vector(0, 0, 0);
var rayCollisionObj = new Object();
var forceVector = ROYGBIV.vector(0, 0, 0);
var forcePositionVector = ROYGBIV.vector(0, 0, 0);
var expPSStartConfigs = new Object();
var expPSQuaternion = ROYGBIV.quaternion();
var expPSYVector = ROYGBIV.vector(0, 1, 0);
var handleRay = function(){
  ROYGBIV.getCameraPosition(rayFromVector);
  ROYGBIV.getCameraDirection(rayDirectionVector);
  ROYGBIV.intersectionTest(rayFromVector, rayDirectionVector, rayCollisionObj);
  if (rayCollisionObj.objectName != null){
    var obj = ROYGBIV.getObject(rayCollisionObj.objectName);
    ROYGBIV.setVector(forcePositionVector, rayCollisionObj.x, rayCollisionObj.y, rayCollisionObj.z);
    if (!obj.isChangeable){
      var expPS = ROYGBIV.getParticleSystemFromPool(ROYGBIV.globals.explosionPool);
      if (expPS){
        expPSStartConfigs.particleSystem = expPS;
        expPSStartConfigs.startPosition = forcePositionVector;
        expPSStartConfigs.startQuaternion = ROYGBIV.computeQuaternionFromVectors(rayDirectionVector, expPSYVector, expPSQuaternion);
        ROYGBIV.startParticleSystem(expPSStartConfigs);
      }
      return;
    }
    ROYGBIV.resetObjectVelocity(obj);
    ROYGBIV.multiplyScalar(rayDirectionVector, 3500, forceVector);
    ROYGBIV.applyForce(obj, forceVector, forcePositionVector);
    var expPS = ROYGBIV.getParticleSystemFromPool(ROYGBIV.globals.explosionPool);
    if (expPS){
      expPSStartConfigs.particleSystem = expPS;
      expPSStartConfigs.startPosition = forcePositionVector;
      expPSStartConfigs.startQuaternion = ROYGBIV.computeQuaternionFromVectors(rayDirectionVector, expPSYVector, expPSQuaternion);
      ROYGBIV.startParticleSystem(expPSStartConfigs);
    }
  }
}

ROYGBIV.globals.lastLaserShootTime = 0;
ROYGBIV.globals.isRight = true;
ROYGBIV.globals.laserStarterFunction = function(){
  if (!isPointerLocked || circularExplosionPoolExpired){
    return;
  }
  if (ROYGBIV.globals.isRight){
    if (!ROYGBIV.isRunning("shootAnimation") && (!ROYGBIV.isRunning("shootAnimation2"))){
      ROYGBIV.globals.shootAnimationAngleCounter = 0;
      ROYGBIV.globals.shootAnimationCounter = 0;
      ROYGBIV.runScript("shootAnimation");
      ROYGBIV.globals.lastLaserShootTime = performance.now();
      ROYGBIV.globals.isRight = false;
      ROYGBIV.globals.startExplosion(ROYGBIV.globals.gun1Pointer);
      handleRay();
    }
  }else{
    if (!ROYGBIV.isRunning("shootAnimation2") && (!ROYGBIV.isRunning("shootAnimation"))){
      ROYGBIV.globals.shootAnimationAngleCounter2 = 0;
      ROYGBIV.globals.shootAnimationCounter2 = 0;
      ROYGBIV.runScript("shootAnimation2");
      ROYGBIV.globals.lastLaserShootTime = performance.now();
      ROYGBIV.globals.isRight = true;
      ROYGBIV.globals.startExplosion(ROYGBIV.globals.gun2Pointer);
      handleRay();
    }
  }
}

