keyboardControls.script:
ROYGBIV.setObjectVelocity(ROYGBIV.globals.body, ROYGBIV.globals.zeroVector, ROYGBIV.globals.xAxis);
ROYGBIV.setObjectVelocity(ROYGBIV.globals.body, ROYGBIV.globals.zeroVector, ROYGBIV.globals.zAxis);

var xVelocity = 0, zVelocity = 0;
var totalXVelocity = 0, totalZVelocity = 0;
if (ROYGBIV.isKeyPressed("W") || ROYGBIV.isKeyPressed("Z")){
  xVelocity -= 200;
}
if (ROYGBIV.isKeyPressed("S")){
  xVelocity += 200;
}
if (ROYGBIV.isKeyPressed("D")){
  zVelocity = -200;
}
if (ROYGBIV.isKeyPressed("A") || ROYGBIV.isKeyPressed("Q")){
  zVelocity = 200;
}

if (ROYGBIV.isKeyPressed("Space")){
  var skip = false;
  if (ROYGBIV.globals.lastJumpTime){
    var now = performance.now();
    if (now - ROYGBIV.globals.lastJumpTime < 1500){
      skip = true;
    }
  }
  if (!ROYGBIV.globals.canJumpAgain){
    skip = true;
  }
  if (!skip){
    ROYGBIV.getPosition(ROYGBIV.globals.body, ROYGBIV.globals.reusableVector1);
    ROYGBIV.applyForce(
      ROYGBIV.globals.body,
      ROYGBIV.globals.impulseYVector,
      ROYGBIV.globals.reusableVector1
    );
    ROYGBIV.globals.lastJumpTime = performance.now();
    ROYGBIV.globals.canJumpAgain = false;
  }
}else{
  ROYGBIV.globals.canJumpAgain = true;
}

totalXVelocity = (xVelocity * Math.cos(ROYGBIV.globals.alpha)) - (zVelocity * Math.sin(ROYGBIV.globals.alpha));
totalZVelocity = (xVelocity * Math.sin(ROYGBIV.globals.alpha)) + (zVelocity * Math.cos(ROYGBIV.globals.alpha));

ROYGBIV.setVector(ROYGBIV.globals.reusableVelocityVector, totalXVelocity, 0, totalZVelocity);
ROYGBIV.setObjectVelocity(ROYGBIV.globals.body, ROYGBIV.globals.reusableVelocityVector, ROYGBIV.globals.xAxis);
ROYGBIV.setObjectVelocity(ROYGBIV.globals.body, ROYGBIV.globals.reusableVelocityVector, ROYGBIV.globals.zAxis);

