psInitializer.script:
var refCircularExplosion = ROYGBIV.createCircularExplosion({
  name: ROYGBIV.generateParticleSystemName(),
  particleCount: 20,
  position: ROYGBIV.vector(0, 0, 0),
  radius: 0.3,
  colorName: "#78ff00",
  particleSize: 8,
  alpha: 0.3,
  alphaVariation: -1,
  speed: 100,
  expireTime: 0.8
});
var resConfettiExplosion = ROYGBIV.createConfettiExplosion({
  name: ROYGBIV.generateParticleSystemName(),
  position: ROYGBIV.vector(0, 0, 0),
  expireTime: 0.6,
  lifetime: 0.6,
  verticalSpeed: 100,
  horizontalSpeed: 100,
  particleCount: 100,
  particleSize: 5,
  colorName: "#78ff00",
  alpha: 0.5,
  verticalAcceleration: -600,
  alphaVariation: -0.9,
});
ROYGBIV.addParticleSystemToPool(ROYGBIV.globals.circularExplosionPool, refCircularExplosion);

for (var i = 0; i<3; i++){
  ROYGBIV.addParticleSystemToPool(ROYGBIV.globals.circularExplosionPool, ROYGBIV.copyParticleSystem(refCircularExplosion, ROYGBIV.generateParticleSystemName()));
}

ROYGBIV.globals.explosionPool = ROYGBIV.createInitializedParticleSystemPool("explosionPool", resConfettiExplosion, 4);

var startConfigurations = {};
var yAxis = "+y";
var yAxisMinus = "-y";
var reusableEndPointVector = ROYGBIV.vector(0, 0, 0);
var reusableEndPointVector2 = ROYGBIV.vector(0, 0, 0);
var reusableDirVector = ROYGBIV.vector(0, 0, 0);
var yVector = ROYGBIV.vector(0, 1, 0);
var reusableQuaternion = ROYGBIV.quaternion();
ROYGBIV.globals.reusablePSPositionVector = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.reusableExplosionPositionVector = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.reusablePlusY = yAxis;
ROYGBIV.globals.lerpVector = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.startExplosion = function(obj){
  var explosionPS = ROYGBIV.getParticleSystemFromPool(ROYGBIV.globals.circularExplosionPool);
  startConfigurations.particleSystem = explosionPS;
  startConfigurations.startPosition = ROYGBIV.getEndPoint(obj, yAxis, reusableEndPointVector);
  ROYGBIV.getEndPoint(obj, yAxisMinus, reusableEndPointVector2);
  ROYGBIV.setVector(reusableDirVector, reusableEndPointVector.x - reusableEndPointVector2.x, reusableEndPointVector.y - reusableEndPointVector2.y, reusableEndPointVector.z - reusableEndPointVector2.z);
  ROYGBIV.computeQuaternionFromVectors(yVector, reusableDirVector, reusableQuaternion);
  startConfigurations.startQuaternion = reusableQuaternion;
  ROYGBIV.startParticleSystem(startConfigurations);
  if (ROYGBIV.globals.isRight){
    ROYGBIV.globals.expPS1 = explosionPS;
  }else{
    ROYGBIV.globals.expPS2 = explosionPS;
  }
}

ROYGBIV.mergeParticleSystems();

this.stop();

shooter.script:
