explosionPositionHandler.script:
if (ROYGBIV.globals.expPS2 && ROYGBIV.globals.expPS2.mesh.visible){
  ROYGBIV.getEndPoint(ROYGBIV.globals.gun1Pointer, ROYGBIV.globals.reusablePlusY, ROYGBIV.globals.reusableExplosionPositionVector);
  ROYGBIV.getPosition(ROYGBIV.globals.expPS2, ROYGBIV.globals.reusablePSPositionVector);
  ROYGBIV.lerp(ROYGBIV.globals.reusablePSPositionVector, ROYGBIV.globals.reusableExplosionPositionVector, 0.5, ROYGBIV.globals.lerpVector);
  ROYGBIV.setParticleSystemPosition(ROYGBIV.globals.expPS2, ROYGBIV.globals.lerpVector.x, ROYGBIV.globals.lerpVector.y, ROYGBIV.globals.lerpVector.z)
}
if (ROYGBIV.globals.expPS1 && ROYGBIV.globals.expPS1.mesh.visible){
  ROYGBIV.getEndPoint(ROYGBIV.globals.gun2Pointer, ROYGBIV.globals.reusablePlusY, ROYGBIV.globals.reusableExplosionPositionVector);
  ROYGBIV.getPosition(ROYGBIV.globals.expPS1, ROYGBIV.globals.reusablePSPositionVector);
  ROYGBIV.lerp(ROYGBIV.globals.reusablePSPositionVector, ROYGBIV.globals.reusableExplosionPositionVector, 0.5, ROYGBIV.globals.lerpVector);
  ROYGBIV.setParticleSystemPosition(ROYGBIV.globals.expPS1, ROYGBIV.globals.lerpVector.x, ROYGBIV.globals.lerpVector.y, ROYGBIV.globals.lerpVector.z);
}
